import React from 'react';
import {useParams} from "react-router-dom";

export default function AirportDetailPage() {
    const params = useParams<'id'>()

    return (
        <div className="container mx-auto pt-5 max-w-760">
            <h1>
                Airport {params.id}
            </h1>
        </div>
    );
};
